Abia State, consistent with its location in the South East geo-political zone of Nigeria which is highly urbanized, boasts of an average population density of 450 persons per square kilometer. The state has several large cities which have experienced rapid population and spatial growth and Aba is ranked as one of the largest commercial centres in the country. Aba is also the most populous city in Abia State and if neglected in its current condition, will be unable to contribute to robust economic growth, which will hinder development of the State.  Most of the problems experienced in the state, such as poverty, slum proliferation, environmental degradation, lack of access to adequate basic services, traffic congestion, housing shortages, flooding and soil erosion are very prevalent in the city. The project will contribute significantly in creating more opportunities for employment generation and direct foreign investment, a key goal of the state government.

The rapid urbanisation being experienced in the state has resulted in several diverse challenges including the following:

i.	Capacity gaps in promoting good urban governance, which is manifested in the non-adoption of city-wide or municipal-wide governance structure, policies and standards;
ii.	Rising poverty as exemplified in the formation of slums and ramshackle housing and business structures that are unplanned, uncontrolled, congested, unkept, eroded, filthy and polluted;
iii.	Traffic congestion and associated air pollution due to poor roads and inadequate transport management systems/infrastructure;
iv.	Non-existence of physical development plans or City Development Strategies;
v.	Inadequate shelter for all;
vi.	Incessant flood of many areas as well as the inadequate provision for essential urban basic services;
vii.	Non-adoption of participatory land use planning and development;
viii.	Inability to mobilize adequate resources for urban development.
ix.	Resilience infrastructure and capacity to support WASH, urban agriculture and settlement planning.

Overall Objective:
The identified problems arise from, among others, non-adoption of long-range Physical Plans/City Development Strategies to tackle the consequences of rapid urbanization; the disharmony between adoption of economic development plans without due emphasis placed on physical planning; poor urban governance framework; lack of adequate finance; lack of political will; and, qualitative and quantitative manpower shortages on the part of the government.

The overall objective of this project is to support the preparation and adoption of Structure Plan for Aba in Abia State, Nigeria, as an overall framework for guiding its future growth and development. The Structure Plans are important tools contributing to informed strategic decision making. They will also provide the framework for further activities aimed at meeting the urban challenges of the city.

The project is also necessary to enable Abia State achieve the objectives of the National Urban Development Policy (2012) and the National Housing Policy (2012) of the Federal Republic of Nigeria, which stipulate that cities should be planned to enable them to effectively address various challenges of urbanization. 

At the international level, Nigeria is committed to the 2030 Agenda and its Sustainable Development Goals (SDGs) as well as the New Urban Agenda adopted at the Habitat III Summit in 2016 and has also been able to decentralize the adoption of poverty reduction strategies through the National, State and Local Economic Empowerment and Development Strategies. By preparing and implementing the Structure Plans, the state government will put Aba city on the path to sustainable growth and development. This would enable the state to achieve both national and international obligations.  

Project Approach:
The proposed solution is to prepare evidence-based spatial development plans for Aba city based on sex-disaggregated data collected and analysed in an inclusive and participatory manner, thereby strengthening the capacity of state, local governments and local planning authorities within the city to implement and monitor physical expansion plans as way of tackling the various challenges of rapid urbanization. 

